import React from 'react';
import Card from './Card'

const CardList = (data, activeItem) => (
    <div className='supply__container'>
        {
            Object.values(data)[0].map((element) => {
                return(
                    <Card 
                        name={element.name}
                        cost={element.cost}
                        img={element.img}
                        activeItem={activeItem}
                    />
                )
            })
        }
    </div>
)

export default CardList;
